import React from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";

const Product = ({ item: { title, price, description } }) => {
  return (
    <Card>
      <CardImg top width="100%" src="/assets/318x180.svg" alt="product" />
      <CardBody>
        <CardTitle>{title}</CardTitle>
        <CardSubtitle>Price: {price}</CardSubtitle>
        <CardText>{description}</CardText>
        <Button>Buy</Button>
      </CardBody>
    </Card>
  );
};

export default Product;
